import React, { Component } from "react";
class Tweet extends Component {
  render() {
    return (
      <div className="tweet">
        <h2>Tweets</h2>
        <amp-twitter
          width="375"
          height="472"
          layout="responsive"
          data-tweetid="638793490521001985"
        ></amp-twitter>
      </div>
    );
  }
}

export default Tweet;
